<?php

namespace App\Services;

use App\Models\users;

class UserService
{
    public function execute(Methods $method, mixed ...$params): mixed
    {
        
        $fn = $method->name;

        return $this->$fn(...$params);

    }

    public function GET(int $userId = null): mixed
    {

        if($userId === null) return users::all();

        return users::find($userId);
    }



    public function POST(object $request): mixed
    {
        $request = users::create([
            'name' => $request->name,
            'group' => $request->group,
            'email' => $request->email,
            'username' => $request->username,
            'password' => bcrypt($request->password),
            'image' => "data:image/jpeg;base64,",
        ]);

        return  response()->json(['user' => $request ? $request->toArray() : null, 'success' => boolval($request)]);
    }

    public function PUT(int $id, array $request): mixed
    {

        $user = users::find($id);

        if($user) $user->update($request);

        if (isset($request["password"]) && strlen($request["password"]) < 60) {
            $request["password"] = bcrypt($request["password"]);
        }
        

        return  response()->json(['user' => $user ? $user->toArray() : null, 'success' => boolval($user)]);
    }

    public function DELETE(int $userId): mixed
    {
        $user = users::where('id', '=', $userId)->delete();
        
        return response()->json(['success' => boolval($user)]);
    }
}
